import React from 'react';
import Img from '../../images/movie.jpg';
import { MovieImg, MovieContainer } from './movieelements';

function movie() {
    return (


        <div>
          <MovieContainer>
          <MovieWrapper></MovieWrapper>
             <MovieImg className="profileuserimg"
                             src={Img}
                             alt=""/>
       
         </MovieContainer>
            
        </div>
    )
}

export default movie
